import React from 'react';
import Button from '@material-ui/core/Button';

const NominationItem = ({ nomination, onRemoveNomination }) => {
    return (
        <div>
            <div>{nomination.Title}</div>
            <Button
                size="small"
                variant="contained"
                color="secondary">Info</Button>
            <Button
                size="small"
                variant="contained"
                color="secondary" onClick={() => onRemoveNomination(nomination)}>Remove</Button>
        </div>
    );
};

export default NominationItem;
